import React from 'react';

function About() {
  return (
    <section id="about">
      <div className="text">
        <h2><span className="typing-text">창의적이고 열정적인 개발자</span></h2>
        <p>저는 창의적이고 열정적인 개발자입니다. 새로운 기술을 배우는 것을 좋아하고, 사용자 경험을 중요하게 생각합니다.</p>
      </div>
    </section>
  );
}

export default About;
